import React from "react";
import Button from "../ui/button";

function Nav() {
  return (
    <>
      <Button />

      <div className="Navbar w-screen flex justify-items-center content-items-center">
        <div className=" button container">
          <a className="tasks" href="/task">
            <span className="font-weight-light">Tasks</span>
          </a>
        </div>
        <div className="button container">
          <a className="Habits" href="/habit">
            <span className="font-weight-light">Habits</span>
          </a>
        </div>
      </div>
    </>
  );
}

export default Nav;
